package model;


public class MaxMinChart {
	private String chartId;
	private String name;
	private double maxTurnover;
	private double minTurnover;
	private double maxVolume;
	private double minVolume;
	private double maxPe;
	private double minPe;
	private double maxPb;
	private double minPb;
	private double maxAdjprice;
	private double minAdjprice;

	public MaxMinChart() {
		// TODO Auto-generated constructor stub
	}

	
	public String getChartId() {
		return chartId;
	}


	public void setChartId(String chartId) {
		this.chartId = chartId;
	}


	public String getName() {
		return name;
	}


	public void setName(String name) {
		this.name = name;
	}


	public double getMaxTurnover() {
		return maxTurnover;
	}

	public void setMaxTurnover(double maxTurnover) {
		this.maxTurnover = maxTurnover;
	}

	public double getMinTurnover() {
		return minTurnover;
	}

	public void setMinTurnover(double minTurnover) {
		this.minTurnover = minTurnover;
	}

	public double getMaxVolume() {
		return maxVolume;
	}

	public void setMaxVolume(double maxVolume) {
		this.maxVolume = maxVolume;
	}

	public double getMinVolume() {
		return minVolume;
	}

	public void setMinVolume(double minVolume) {
		this.minVolume = minVolume;
	}

	public double getMaxPe() {
		return maxPe;
	}

	public void setMaxPe(double maxPe) {
		this.maxPe = maxPe;
	}

	public double getMinPe() {
		return minPe;
	}

	public void setMinPe(double minPe) {
		this.minPe = minPe;
	}

	public double getMaxPb() {
		return maxPb;
	}

	public void setMaxPb(double maxPb) {
		this.maxPb = maxPb;
	}

	public double getMinPb() {
		return minPb;
	}

	public void setMinPb(double minPb) {
		this.minPb = minPb;
	}

	public double getMaxAdjprice() {
		return maxAdjprice;
	}

	public void setMaxAdjprice(double maxAdjprice) {
		this.maxAdjprice = maxAdjprice;
	}

	public double getMinAdjprice() {
		return minAdjprice;
	}

	public void setMinAdjprice(double minAdjprice) {
		this.minAdjprice = minAdjprice;
	}

}
